function getData() {
    return {
        formData: {
            nome: "",
            sobrenome: "",
            cpf: "",
            email: "",
            cep: "",
            rua: "",
            bairro: "",
            cidade: "",
            uf: "",
            password: "",
            password_confirm: "",

        },
        open: false,
        user_name: "",
        login_email: "",
        login_pass: "",
        passwordStrengthText: '',
        togglePassword: false,
        dataCEP: "",
        status: false,
        loading: false,
        isError: false,
        modalHeaderText: "",
        modalBodyText: "",
        showAlert: false,
        bg: 'data:image/jpeg;base64,',
        buttonLabel: 'Finalizar',
        image: 'data:image/jpeg;base64,',
        isEmail(email) {
            var re = /\S+@\S+\.\S+/;
            return re.test(email);
        },

        isNome(nome){
            if(nome != ""){
                return nome
            }
        },

        isSobrenome(sobrenome){
            if(sobrenome != ""){
                return sobrenome
            }
        },

        isCPF(cpf){
            var re = new RegExp("[0-9]{3}\.?[0-9]{3}\.?[0-9]{3}\-?[0-9]{2}");
            return re.test(cpf);
        },

        isCEP(value){

            var cep = value.replace(/\D/g, '');

            //Verifica se campo cep possui valor informado.
            if (cep != "") {

                //Expresso regular para validar o CEP.
                var validacep = /^[0-9]{8}$/;

                //Valida o formato do CEP.
                if(validacep.test(cep)) {
                    console.log("agora sim")

                    
                    var url = 'https://viacep.com.br/ws/' + cep + '/json/';

                    var xhttp = new XMLHttpRequest();
                    xhttp.onreadystatechange = function () {
                        if (this.readyState == 4) {
                            if (this.status == 200) {
                                var result = JSON.parse(this.responseText);

                                this.dataCEP = result;
                                document.getElementById("rua").value = this.dataCEP.logradouro
                                document.getElementById("bairro").value = this.dataCEP.bairro
                                document.getElementById("cidade").value = this.dataCEP.localidade
                                document.getElementById("uf").value = this.dataCEP.uf
                            }
                        }
                    };
                    xhttp.open('GET', url, true);
                    xhttp.send();
                    return true;
                } 
                else {
                    return false;
                }
            } 

        },

        checkPasswordStrength() {
            var strongRegex = new RegExp("^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#\$%\^&\*])(?=.{8,})");
            var mediumRegex = new RegExp("^(((?=.*[a-z])(?=.*[A-Z]))|((?=.*[a-z])(?=.*[0-9]))|((?=.*[A-Z])(?=.*[0-9])))(?=.{6,})");

            let value = this.formData.password;

            if (strongRegex.test(value)) {
                this.passwordStrengthText = "Senha forte";
            } else if(mediumRegex.test(value)) {
                this.passwordStrengthText = "Poderia ser mais forte";
            } else {
                this.passwordStrengthText = "Senha fraca";
            }
        },


        submitData() {
            // Garante que todos os campos tenham dados antes de enviar
            if (!this.formData.email.length ||
                !this.formData.password.length ||
                !this.formData.nome.length ||
                !this.formData.sobrenome.length) {
                window.scrollTo({ top: 0, behavior: 'smooth' });
                this.showAlert = true;
                return;
            }
            this.buttonLabel = 'Enviando...'
            this.loading = true;
            fetch('https://reqres.in/api/users', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    body: JSON.stringify(this.formData)
                })
                .then((response) => {
                    if (response.status === 201) {
                        
                        this.modalHeaderText = "Parabns!!!"
                        this.modalBodyText = "Voc foi registrado com sucesso!";
                        this.status = true;
                        var email = this.formData.email
                        var password = this.formData.password
                        this.setCookie("user_details", JSON.stringify({email: email, pass: password}), 365)
                        window.location.href = "home.html";
                        
                    } else {
                        throw new Error("Seu registro falhou");
                    }
                })
                .catch((error) => {
                    this.modalHeaderText = "Ooops Error!"
                    this.modalBodyText = error.message;
                    this.isError = true;
                })
                .finally(() => {
                    this.loading = false;
                    this.buttonLabel = 'Finalizar'
                })
        },

      
        validlogin(){
            console.log(this.getCookie("user_details").length)

            if(this.getCookie("user_details").length == 0){
                this.showAlert = true;
            }else{
                let user = this.getCookie("user_details");
                var user_details = JSON.parse(user)

                if(user_details["email"] == this.login_email && user_details["pass"] == this.login_pass){
                    window.location.href = "home.html";
                } else{
                    this.showAlert = true;
                }
            }
            
        },


        setCookie(cname, cvalue, exdays){
            const d = new Date();
            d.setTime(d.getTime() + (exdays*24*60*60*1000));
            let expires = "expires=" + d.toUTCString();
            document.cookie = cname + "=" + cvalue + ";" + expires + ";path=/";
        },


        getCookie(cname) {
            let name = cname + "=";
            let decodedCookie = decodeURIComponent(document.cookie);
            let ca = decodedCookie.split(';');
            for(let i = 0; i < ca.length; i++) {
              let c = ca[i];
              while (c.charAt(0) == ' ') {
                c = c.substring(1);
              }
              if (c.indexOf(name) == 0) {
                return c.substring(name.length, c.length);
              }
            }
            return "";
        },

        checkCookie() {
            if(this.getCookie("user_details").length == 0){
                this.showAlert = false;
            }else{
                let user = this.getCookie("user_details");
                var user_details = JSON.parse(user)
                this.login_pass = user_details["pass"]
                this.login_email =  user_details["email"]
            }
        },

        dataUser() {
            let user = this.getCookie("user_details");
            var user_details = JSON.parse(user)
            this.user_name = user_details["email"]
        },

        eraseCookie(name) {   
            document.cookie = name+'=; Max-Age=-99999999;';  
        },


        logout(){
            this.eraseCookie("user_details")
            window.location.href = "index.html"
        }

        
    }
  
}